import React, { useState } from "react";
import "./App.css";
import { VolcanoList } from "./components/VolcanoList";

function App() {
  const [volcanos, setVolcanos] = useState();
  return <VolcanoList volcanos={volcanos} setVolcanos={setVolcanos} />;
}

export default App;
